         {/* <SideBar />  */}
         {show && <div id="sideBarHIde">
         <SideBar /> 
          </div>}
          <div id="extra">
          <SideBar /> 
          </div>

        </div>
        &nbsp;&nbsp;
        <div className="A-2">

          <svg onClick={open} 
            xmlns="http://www.w3.org/2000/svg"
            width="23"
            height="23"
